const PostItem = (props) => {
  return ( 
    <div className="post">
      <figure className="">
        <img src={props.post.img} alt="Описание изображения"/>
        <figcaption>{props.tags}</figcaption>
      </figure>
      <h2>{props.post.title}</h2>
      <div>{props.post.autor} {props.post.date} {props.post.views}</div>
      <p>{props.post.text}</p>
    </div>
  );
}

export default PostItem;
